import './App.css';
import Login from './Login';
import Home from './Home';
import { BrowserRouter, Route, Switch } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <div>
          <Route path="/" exact component={Login} />

          <Route path="/Home" component={Home} />
        </div>
      </div>
    </BrowserRouter>

  );
}

export default App;
